import React from 'react'
import Sidebar from './Sidebar/Sidebar'
import Feed from './Feed/Feed'
import Widgets from './Widgets/Widgets'

const Home = () => {

  const user=userAuthState(auth)

  const handleLogout=()=>{
    signOut(auth);
  }

  return (
    <div className='app'>
    <Sidebar handleLogout={handleLogout} user={user}/>
    <Feed/>
    <Widgets/>
    </div>
  )
}

export default Home
